import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
    render() {
        return (
            <div id="MainApp">
                <div className="Buttons">
                    <PeopleButton />
                    <PlacesButton />
                    <DatesButton />
                </div>
                <Search />
                <Input />
                <Data />
            </div>
        );
    }
}

export default App;

class PeopleButton extends Component {
    constructor(props) {
        super(props);
        this.state = { people: false };
    }
    render() {
        if (this.state.people) {
            return 'Doctors page';
        }
        return e(
            'button',
            { onClick: () => this.setState({ people: true }) },
            'Doctors, Nurses, Staff'
        );
    }
}
class PlacesButton extends React.Component {
    constructor(props) {
        super(props);
        this.state = { places: false };
    }
    render() {
        if (this.state.places) {
            return 'Places page';
        }
        return e(
            'button',
            { onClick: () => this.setState({ places: true }) },
            'Hospitals, Clinics, Locations'
        );
    }
}
class DatesButton extends React.Component {
    constructor(props) {
        super(props);
        this.state = { dates: false };
    }
    render() {
        if (this.state.dates) {
            return 'Dates page';
        }
        return e(
            'button',
            { onClick: () => this.setState({ dates: true }) },
            'Appointments, Trips, Dates'
        );
    }
}

class Search extends React.Component {
    render() {
        return <input type="text"></input>
    }
}
class Input extends React.Component {
    render() {
        return <input type="text"></input>
    }
}
